    def wordBreak(self, s, dict):
        # write your code here
        if len(dict) == 0 and len(s) != 0:
            return False
        length = len(s)
        res = [False] * (length + 1)
        res[0] = True
        for i in xrange(0, length + 1):
            if not res[i]:
                continue
            for word in dict:
                size = len(word)
                end = i + size
                if end > length:
                    continue
                if s[i:end] == word:
                    res[end] = True
        return res[length]


